import React, {Component} from "react";
import {withRouter} from "react-router-dom";


class Noviceguide extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    add=()=>{
        this.props.history.push("/soosnovice")
    }
    render() {
        return (<div className={"soosnovice"}>
            <img alt={"标本"} onClick={this.add} className={"soimg"} src={"https://image.hongbeibang.com/FqTIqQgUiGzbGvFBjYJyJRIvmb7W?80X80&imageView2/1/w/80/h/80"} />
            <p className={"sosobtn"} onClick={this.add}>新手指南</p>
        </div>)
    }

}

export default withRouter(Noviceguide);
